$(document).ready(function(){
  
  $('body').on('click','.fancyble', function() {
  	var els = $(this).parent().find('.fancyble');
  	var index = $(this).data('index');
  	console.log(els.length);
  	var fancyarr = [];
  	for (i=0; i<els.length; i++) {
  		fancyarr.push( { href: $(els[i]).data('image'), title: "Image Number " + i, } );
  	}

      $.fancybox.open( fancyarr, {
      	padding: 0,
      	index: index,
      	prevEffect: 'fade',
      	nextEffect: 'fade',
      	nextSpeed: 750,
      	prevSpeed: 750,
  	});

  	return false;	
  });

  load_google_maps();

  $(window).scroll(function () {
    if ($(this).scrollTop() > 600) {
      $('.scrollup').fadeIn();
    } else {
      $('.scrollup').fadeOut();
    }
  });

  $('.scrollup').click(function () {
    $("html, body").animate({
        scrollTop: 0
      }, 600);
      return false;
  });

  $.each( $('.slider_container'), function() {
    load_jssor( $(this).attr('id') );
  });

  update_overflow();
});

